import { useNavigate } from "react-router-dom"
import "./404.css";

const NotPage = ()  =>{
    const navigate = useNavigate();

    function backbtn() {
        let user = localStorage.getItem('user');
        if(user){
            navigate('/home')
        }
    }
  return (
    <div id="NotPage">
    <section>
            <button onClick={backbtn}>login</button>
    </section>
    </div>
  );
}

export default NotPage;
